import React from "react";
import {
  FaCartArrowDown,
  FaFacebook,
  FaInstagram,
  FaWhatsapp,
} from "react-icons/fa";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <section className="flex flex-col bg-gradient-to-r from-cyan-500 to-indigo-500">
      <nav>
        {/* logo */}
        <p>All-Hadi</p>
        <Link to="/">Home</Link>
        <Link to="/">Login</Link>
        <Link to="/">Sign-Up</Link>
      </nav>
      <div className="">
        {/* social Icons  */}
        <div className="">
          <FaFacebook />
          <FaWhatsapp />
          <FaInstagram />
        </div>
        <Link to="/cart">
          <FaCartArrowDown />
        </Link>
      </div>
    </section>
  );
};

export default Navbar;
